import { Component, OnInit, EventEmitter, Output } from '@angular/core';
import { Router } from '@angular/router';
import { AuthService } from '../auth-service.service';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { HttpClient } from '@angular/common/http';
import { AppConfig } from '../app.config';

@Component({
  selector: 'app-student-dashboard',
  templateUrl: './student-dashboard.component.html',
  styleUrls: ['./student-dashboard.component.css']
})
export class StudentDashboardComponent implements OnInit {
  username: string = ''; // To store the username
  studentForm: FormGroup; // FormGroup for the student form
  @Output() logout = new EventEmitter<void>();

  constructor(
    private router: Router,
    private authService: AuthService,
    private fb: FormBuilder,
    private http: HttpClient
  ) {
    // Initialize the student form
    this.studentForm = this.fb.group({
      name: ['', Validators.required],
      email: ['', [Validators.required, Validators.email]],
      education: ['', Validators.required],
      marks10: [''],
      marks12: [''],
      gradmarks: [''],
      graduYear: [''],
      dob: [''],
      skills: [''],
      experience: ['']
    });
  }

  ngOnInit() {
    const username = this.authService.getUser(); // Retrieve user data
    if (username) {
      this.username = username.username; // Get the username
    } else {
      this.router.navigate(['/student-dashboard']); // Redirect if user not found
    }
  }

  onLogout() {
    this.authService.clearUser(); // Clear user data
    this.router.navigate(['/']); // Redirect to login page
  }

  onSubmit(): void {
    if (this.studentForm.valid) {
      // this.http.post('http://localhost:8080/studentsDash/register', this.studentForm.value)
      this.http.post(`${AppConfig.apiUrl}/studentsDash/register`, this.studentForm.value)
        .subscribe(response => {
          console.log('Student registered successfully', response);
          // Optionally reset the form or redirect after submission
          this.studentForm.reset(); // Resets the form
        }, error => {
          console.error('Error occurred during registration', error);
        });
    }
  }

  navigateToDrive() {
    this.router.navigate(['/drive']);
  }
}

<h3>Welcome to Student Dashboard {{ username }}!</h3>
<!-- <button (click)="onLogout()">Logout</button>
<button (click)="navigateToDrive()">Company Drives</button> -->

<button (click)="onLogout()" style="display: block; margin-bottom: 10px;">Logout</button>

<button (click)="navigateToDrive()" style="display: block;">Company Drives</button>


<form [formGroup]="studentForm" (ngSubmit)="onSubmit()">
  <div>
    <br>
    <label for="name">Name</label>
    <input id="name" formControlName="name" placeholder="Enter your name" />
    <div *ngIf="studentForm.get('name')?.invalid && studentForm.get('name')?.touched">
      Name is required
    </div>
  </div>
<br>
  <div>
    <label for="email">Email</label>
    <input id="email" formControlName="email" placeholder="Enter your email" />
    <div *ngIf="studentForm.get('email')?.invalid && studentForm.get('email')?.touched">
      Valid email is required
    </div>
  </div>
  <br>
  <div>
    <label for="education">Education</label>
    <input id="education" formControlName="education" placeholder="Enter your education" />
    <div *ngIf="studentForm.get('education')?.invalid && studentForm.get('education')?.touched">
      Education is required
    </div>
  </div>
  <br>
  <div>
    <label for="marks10">10th Marks</label>
    <input id="marks10" formControlName="marks10" placeholder="Enter your 10th Marks" />
  </div>
  <br>
  <div>
    <label for="marks12">12th Marks</label>
    <input id="marks12" formControlName="marks12" placeholder="Enter your 12th Marks" />
  </div>
  <br>
  <div>
    <label for="gradmarks">Graduation</label>
    <input id="gradmarks" formControlName="gradmarks" placeholder="Enter your Graduation Marks" />
  </div>
  <br>
  <div>
    <label for="graduYear">Passing Graduation Year</label>
    <input id="graduYear" formControlName="graduYear" placeholder="Enter your Passing Graduation Year" />
  </div>
  <br>
  <!-- <div>
    <label for="dob">Date Of Birth</label>
    <input id="dob" formControlName="dob" placeholder="Enter your Date Of Birth" />
  </div> -->
  <div>
    <label for="dob">Date Of Birth</label>
    <input id="dob" type="date" formControlName="dob" placeholder="Enter your Date Of Birth" />
  </div>

  <br>
  <div>
    <label for="skills">Skills</label>
    <input id="skills" formControlName="skills" placeholder="Enter your skills" />
  </div>
  <br>
  <div>
    <label for="experience">Experience</label>
    <input id="experience" formControlName="experience" placeholder="Enter your experience" />
  </div>
  <br>
  <button type="submit" [disabled]="studentForm.invalid">Submit</button>
</form>
